<!DOCTYPE html>
<html>
<head>
	<title>Complex Layout</title>
	<link rel="stylesheet" type="text/css" href="css/style.css">
</head>
<body>
	<div class="header">
		<div class="wrapper">
			<div class="header_body"></div>
		</div>
	</div>
	<div class="body_up">
		<div class="wrapper">
			<div class="body_up_content">
				<div class="body_up_left left">
					<div class="body_up_left_wrapper">
						<div class="body_up_left_content"></div>
						<div class="body_up_left_content"></div>
					</div>
				</div>
				<div class="body_up_right right">
					<div class="body_up_right_wrapper">
						<div class="body_up_right_up">
							<div class="body_up_right_up_wrapper">
								<div class="body_up_right_up_left left">
									<div class="body_up_right_up_left_top">
										<div class="body_up_right_up_left_top_content left"></div>
										<div class="body_up_right_up_left_top_content right"></div>
									</div>
									<div class="body_up_right_up_left_bottom"></div>
								</div>
								<div class="body_up_right_up_right right"></div>
							</div>
						</div>
						<div class="body_up_right_middle"></div>
						<div class="body_up_right_bottom">
							<div class="body_up_right_bottom_content left"></div>
							<div class="body_up_right_bottom_content right"></div>
						</div>
					</div>
				</div>
			</div>
		</div>
	</div>
	<div class="body_middle">
		<div class="wrapper">
			<div class="body_middle_content"></div>
		</div>
	</div>
	<div class="body_bottom">
		<div class="wrapper">
			<div class="body_bottom_content">
				<div class="body_bottom_left left"></div>
				<div class="body_bottom_right right"></div>
			</div>
		</div>
	</div>
	<div class="footer">
		<div class="wrapper">
			<div class="footer_content"></div>
		</div>
	</div>
</body>
</html>
